INSERT INTO `sk_privasi` (`id`, `judul`, `kategori`, `isi`, `created_at`, `updated_at`) VALUES
('0198b8ba-ff8f-71fe-98ce-c18de4f69c4f', 'Kebijakan Privasi Anima Properti', 'kebijakan-privasi', '<p>Di Anima Properti, kami menghargai dan melindungi privasi Anda. Kebijakan privasi ini menjelaskan bagaimana kami mengumpulkan, menggunakan, menyimpan, dan melindungi data pribadi Anda ketika menggunakan layanan kami, baik melalui website, aplikasi, maupun interaksi langsung dengan tim kami.<br><br><strong>1. Informasi yang Kami Kumpulkan</strong></p><ul><li>Kami dapat mengumpulkan beberapa jenis data pribadi, termasuk namun tidak terbatas pada:</li><li>Informasi identitas (nama lengkap, tanggal lahir, nomor identitas).</li><li>Informasi kontak (alamat, nomor telepon, email).</li><li>Informasi properti (kebutuhan, preferensi, lokasi, dan riwayat transaksi).</li><li>Informasi keuangan (jika diperlukan untuk transaksi pembelian/penyewaan).</li><li>Data penggunaan layanan (log aktivitas di website/aplikasi, cookies, alamat IP).</li></ul><p><br><strong>2. Cara Kami Menggunakan Informasi</strong><br>Data yang kami kumpulkan digunakan untuk:</p><ul><li>Memberikan layanan pencarian, penawaran, penjualan, atau penyewaan properti.</li><li>Menghubungi Anda terkait permintaan informasi, transaksi, atau layanan pelanggan.</li><li>Mengelola hubungan bisnis antara Anda dengan Anima Properti.</li><li>Memberikan informasi terbaru mengenai properti, promosi, atau layanan kami.</li><li>Meningkatkan pengalaman pengguna melalui analisis penggunaan layanan.</li><li>Memenuhi kewajiban hukum dan peraturan yang berlaku.</li></ul><p><br><strong>3. Pembagian Informasi dengan Pihak Ketiga</strong><br>Kami tidak akan menjual atau menyewakan data pribadi Anda kepada pihak ketiga. Namun, kami dapat membagikan data dengan pihak ketiga tertentu untuk tujuan:</p><ul><li>Mitra bisnis atau pengembang properti yang terkait langsung dengan permintaan Anda.</li><li>Penyedia layanan pihak ketiga (misalnya sistem pembayaran, layanan IT).</li><li>Otoritas hukum atau pemerintah jika diwajibkan oleh undang-undang.</li></ul><p><br><strong>4. Penyimpanan dan Keamanan Data</strong><br>Kami menggunakan langkah-langkah teknis dan organisasi yang sesuai untuk melindungi data pribadi Anda dari akses tidak sah, kehilangan, atau penyalahgunaan.<br>Data Anda hanya disimpan selama diperlukan sesuai dengan tujuan pengumpulan atau ketentuan hukum yang berlaku.<br><br><strong>5. Hak Anda</strong><br>Anda memiliki hak untuk:</p><ul><li>Mengakses data pribadi yang kami simpan tentang Anda.</li><li>Meminta perbaikan atau pembaruan atas data pribadi Anda.</li><li>Meminta penghapusan data pribadi, sejauh diizinkan oleh hukum.</li><li>Menolak penggunaan data pribadi untuk kepentingan pemasaran.</li><li>Untuk menggunakan hak ini, Anda dapat menghubungi kami melalui informasi kontak di bawah.</li></ul><p><br><strong>6. Cookies dan Teknologi Pelacakan</strong><br>Website kami dapat menggunakan cookies atau teknologi serupa untuk meningkatkan pengalaman pengguna. Anda dapat mengatur browser Anda untuk menolak cookies, namun beberapa fitur mungkin tidak berfungsi dengan baik.<br><br><strong>7. Perubahan Kebijakan Privasi</strong><br>Kami dapat memperbarui kebijakan privasi ini dari waktu ke waktu untuk menyesuaikan dengan perkembangan hukum, teknologi, atau layanan kami. Setiap perubahan akan diumumkan melalui website resmi kami.<br><br><strong>8. Kontak Kami</strong><br>Jika Anda memiliki pertanyaan atau permintaan terkait kebijakan privasi ini, silakan hubungi:</p><p><br><strong>Anima Properti</strong><br>Email: propertianima@gmail.com<br>Telepon: +62 811-4617-733<br>Alamat: Jl. Mutiara Boulevard - Ruko Saphire No.49 - Makassar, 90243</p>', '2025-08-17 15:51:59', '2025-08-17 15:51:59'),
('0198b8bb-461a-7332-af02-60670e2981c9', 'Syarat dan Ketentuan Agen Properti Anima Properti', 'syarat-ketentuan', '<p>Dokumen ini mengatur hak dan kewajiban antara Anima Properti (‚ÄúPerusahaan‚Äù) dengan Agen Properti (‚ÄúAgen‚Äù) yang bergabung dan bekerja sama dalam kegiatan pemasaran, penjualan, maupun penyewaan properti melalui platform dan jaringan Anima Properti.<br><br>Dengan mendaftar dan/atau menjalankan aktivitas sebagai Agen di Anima Properti, maka Agen dianggap telah membaca, memahami, dan menyetujui seluruh syarat dan ketentuan berikut:<br><br><strong>1. Pendaftaran dan Keanggotaan</strong><br>1.1. Agen wajib mengisi data diri dengan lengkap, benar, dan dapat dipertanggungjawabkan.<br>1.2. Perusahaan berhak melakukan verifikasi dan menolak pendaftaran apabila data yang diberikan tidak valid.<br>1.3. Agen wajib menjaga kerahasiaan akun yang diberikan dan bertanggung jawab penuh atas segala aktivitas yang dilakukan melalui akun tersebut.<br><br><strong>2. Hak dan Kewajiban Agen</strong><br>2.1. Agen berhak memasarkan produk properti yang tersedia di Anima Properti sesuai dengan ketentuan perusahaan.<br>2.2. Agen wajib memberikan informasi yang benar, jelas, dan tidak menyesatkan kepada calon pembeli/penyewa.<br>2.3. Agen dilarang melakukan praktik curang, manipulatif, atau merugikan perusahaan maupun pihak ketiga.<br>2.4. Agen wajib menjaga nama baik, reputasi, dan citra Anima Properti dalam setiap aktivitas pemasaran.<br><br><strong>3. Komisi dan Pembayaran</strong><br>3.1. Agen berhak menerima komisi dari setiap transaksi yang berhasil sesuai dengan ketentuan yang ditetapkan oleh perusahaan.<br>3.2. Besaran komisi dapat berubah sewaktu-waktu sesuai kebijakan perusahaan dengan pemberitahuan terlebih dahulu.<br>3.3. Pembayaran komisi dilakukan setelah transaksi dinyatakan sah, lunas, dan tidak ada sengketa dari pihak terkait.<br><br><strong>4. Kewajiban Perusahaan</strong><br>4.1. Perusahaan menyediakan materi pemasaran, dukungan informasi, dan sistem kerja yang dapat digunakan oleh Agen.<br>4.2. Perusahaan wajib memberikan laporan transaksi dan pembayaran komisi secara transparan.<br>4.3. Perusahaan berhak menegur, menangguhkan, atau menghentikan kerja sama dengan Agen apabila terbukti melanggar ketentuan.<br><br><strong>5. Larangan</strong><br>5.1. Agen dilarang menggunakan data perusahaan untuk kepentingan pribadi atau pihak lain tanpa izin tertulis.<br>5.2. Agen dilarang melakukan promosi yang bersifat menipu, mengandung SARA, pornografi, atau bertentangan dengan hukum yang berlaku.<br>5.3. Agen dilarang melakukan kerja sama ganda dengan pihak kompetitor dengan cara yang dapat merugikan Anima Properti.<br><br><strong>6. Kerahasiaan</strong><br>6.1. Segala data, informasi, dan dokumen yang diperoleh selama kerja sama dianggap bersifat rahasia.<br>6.2. Agen wajib menjaga kerahasiaan data tersebut dan tidak menyebarkannya tanpa persetujuan tertulis dari perusahaan.<br><br><strong>7. Pemutusan Kerja Sama</strong><br>7.1. Agen dapat mengundurkan diri dengan pemberitahuan tertulis minimal 14 hari sebelum tanggal efektif berhenti.<br>7.2. Perusahaan berhak menghentikan kerja sama sewaktu-waktu apabila Agen terbukti melanggar syarat dan ketentuan ini.<br>7.3. Hak komisi yang belum dibayarkan tetap akan diselesaikan sesuai ketentuan setelah pemutusan kerja sama.<br><br><strong>8. Hukum yang Berlaku</strong><br>8.1. Syarat dan ketentuan ini tunduk pada hukum yang berlaku di Republik Indonesia.<br>8.2. Segala perselisihan yang timbul akan diselesaikan secara musyawarah, dan jika tidak tercapai, akan diselesaikan melalui jalur hukum sesuai ketentuan perundang-undangan yang berlaku.<br><br><strong>9. Perubahan Syarat dan Ketentuan</strong><br>9.1. Perusahaan berhak mengubah atau memperbarui syarat dan ketentuan ini sewaktu-waktu.<br>9.2. Setiap perubahan akan diberitahukan kepada Agen dan berlaku sejak tanggal yang ditentukan perusahaan.</p>', '2025-08-17 15:52:17', '2025-08-17 15:52:17');
