INSERT INTO `tentang_kamis` (`id`, `key`, `value`, `created_at`, `updated_at`) VALUES
('01987f58-d154-73ff-b097-8a14d9f80b52', 'about_title', 'Anima Properti', '2025-08-06 12:26:23', '2025-08-06 12:26:23'),
('01987f58-d155-7163-b2bb-5b3459c963ff', 'about_description', '<p>Anima Properti adalah agen properti terpercaya di Makassar yang membantu Anda menemukan rumah idaman dengan proses mudah, aman, dan transparan. Kami melayani jual beli rumah dari berbagai developer ternama, termasuk Summarecon Mutiara Makassar dan perumahan lainnya di Indonesia Timur. Dengan pengalaman, pengetahuan lokal, dan pendekatan personal, kami hadir untuk mewujudkan hunian impian Anda.<br><br><br></p>', '2025-08-06 12:26:23', '2025-08-06 12:26:23'),
('01987f58-d156-71dc-bfdd-206f0c52dcfe', 'visi', '<p>Menjadi agen properti terdepan dan paling dipercaya di Makassar dan kawasan Indonesia Timur, sebagai pilihan utama masyarakat dalam membeli rumah baru yang berkualitas dan bernilai investasi.</p>', '2025-08-06 12:26:23', '2025-08-06 12:26:23'),
('01987f58-d156-71dc-bfdd-206f0cb8d679', 'misi', '<ul><li>Memberikan layanan konsultasi properti yang jujur, profesional, dan personal.</li><li>Menyediakan pilihan rumah terbaik dari berbagai developer terpercaya.</li><li>Membangun hubungan jangka panjang dengan pelanggan melalui kepercayaan dan integritas.</li><li>Mengedukasi masyarakat tentang proses jual beli properti secara mudah dan aman.</li><li>Menjadi jembatan antara developer dan pembeli yang mengedepankan kepuasan kedua&nbsp;belah&nbsp;pihak.</li></ul>', '2025-08-06 12:26:23', '2025-08-06 12:26:23'),
('01987f58-d157-735b-b2f0-9f3c195d6930', 'about_image', 'about/01K1ZNHMAHPFEDAQ6XCFJZ6RDJ.jpg', '2025-08-06 12:26:23', '2025-08-06 12:26:23'),
('01987f58-d158-71ac-8537-c1b510110a50', 'property_sold', '18', '2025-08-06 12:26:23', '2025-09-16 11:18:29'),
