INSERT INTO `testimonis` (`id`, `nama`, `jabatan`, `pesan`, `is_active`, `created_at`, `updated_at`) VALUES
('0198b8be-28b7-7141-b632-ecbf5763d75b', 'Nurma Kumalasari', 'Pengusaha', 'Saya sangat terbantu dengan layanan profesional tim ini. Dalam waktu singkat, saya berhasil menemukan rumah impian saya di lokasi yang strategis.', 1, '2025-08-17 15:55:26', '2025-08-17 15:55:26'),
('0198b8be-8b0c-71c9-9ff6-52e55c19da72', 'Ahmad Sibuni', 'Karyawan BUMN', 'Proses pembelian berjalan mulus dan transparan. Saya merasa aman dan nyaman selama seluruh prosesnya. Sangat direkomendasikan!', 1, '2025-08-17 15:55:51', '2025-08-17 15:55:51'),
('0198b8c0-fb3e-7380-b4fd-f1094e6daea8', 'Christian Rantetampang', 'CEO', 'Agen sangat responsif dan informatif. Mereka memberikan banyak opsi properti sesuai kebutuhan saya. Pelayanan terbaik yang pernah saya dapatkan.', 1, '2025-08-17 15:58:31', '2025-08-17 15:58:31'),
('0198b8c1-4a21-7378-884b-78e0ab802673', 'Arby Ardiansyah', 'Pilot', 'Berbagai pilihan properti yang ditawarkan sangat lengkap dan terpercaya. Terima kasih telah membantu saya berinvestasi dengan tepat.', 1, '2025-08-17 15:58:51', '2025-08-17 15:58:51');
